import React from 'react';
import logo from './logo.svg';
import './App.css';

class App extends React.Component {
    constructor(props) {
        super(props);
        this.state = {apiResponse: ''}
    }

    callAPI() {
        fetch("http://localhost:9000/test")
            .then(res => res.text())
            .then(res => this.setState({apiResponse: res}))
    }

    componentDidMount() {
        this.callAPI()
    }

    render() {
        return <h1> {this.callAPI()}</h1>
    }
}

